You can set environment variables for your app by creating a file called .env in the application folder. Here is an example of a .env file: BEARER_TOKEN=SECURE_TOKEN Use the Deno.env.get method to access the environment variables in your app: // File: ~/localhost/demo/main.ts
export default function (req: Request) { if (req.headers.get("Authorization") !== `Bearer ${Deno.env.get("BEARER_TOKEN")}`) { return new Response("Unauthorized", { status: 401 }); } return new Response(`I'm private!`, { headers: { "Content-Type": "text/plain", }, });
} If you want to set an environment variable for all your apps, you can use the env property from the smallweb global config (~/.config/smallweb/config.json[c]).

